import './App.css';
import {
  BrowserRoute as Router ,
  Switch,
  Route,
  Link
} from "react-router-dom"
import Login from "./component/Login"

function App() {
  return (
    <>
    <div>
      <Router>
        <Switch>
          <Route path="/users">
            <User />
          </Route>
          <Route path="/">
            <Login />
          </Route>
        </Switch>
      </Router>
    </div>

    </>
  );
}

export default App;
